import React from 'react';
import data from './levels.json'
import Tracks from './Tracks'


function App() {
  const value = 'World';
  return (
    <div>
      <h1>F1 2022 Difficulty Helper</h1>
      <div>
          <Tracks data={data} />
      </div>
    </div>
  );
}

export default App;
